import React from 'react';

const LoginPage = () => {
    return (
        <div>
            <h3>Login</h3>

            <form>
                <input type='text' placeholder="email" name="email"/>
                <input type='password' placeholder="password" name="password"/>
                <button type="submit">Login</button>

            </form>
        </div>
    );
};

export default LoginPage;
